tables.table_schema:
CREATE TABLE distribution_data (
    input_data VARCHAR(255),
    output_data VARCHAR(255)
);

CREATE TABLE variability_data (
    model_id INT,
    variability_score DECIMAL(10, 2)
);

CREATE TABLE InputData (
  data_id INT PRIMARY KEY,
  input_data JSONB
);

CREATE TABLE NeuralNetworks (
  network_id INT PRIMARY KEY,
  network_name VARCHAR(255),
  layers INT,
  activation_function VARCHAR(50)
);

CREATE TABLE input_data_distribution (
    id INT PRIMARY KEY,
    input_data VARCHAR(255),
    distribution_metric DECIMAL,
    variability_metric DECIMAL
);

CREATE TABLE neural_network_configuration (
    id INT PRIMARY KEY,
    network_name VARCHAR(50),
    layer_count INT,
    activation_function VARCHAR(50)
);

CREATE TABLE data_variability_metrics (
    id INT PRIMARY KEY,
    dataset_name VARCHAR(50),
    variability_metric DECIMAL,
    variability_label VARCHAR(50)
);

CREATE TABLE NeuralNetworks (
  id INT PRIMARY KEY,
  input_data TEXT,
  variability TEXT
);

CREATE TABLE InputDataStatistics (
  id INT PRIMARY KEY,
  input_data_id INT,
  mean FLOAT,
  std_dev FLOAT
);

CREATE TABLE ModelResults (
  id INT PRIMARY KEY,
  model_id INT,
  accuracy FLOAT,
  loss FLOAT
);

CREATE TABLE TrainingData (
  id INT PRIMARY KEY,
  dataset_id INT,
  data_type TEXT,
  data_amount INT
);

CREATE TABLE ModelArchitectures (
  model_id INT PRIMARY KEY,
  architecture TEXT,
  layers INT,
  activation_function TEXT
);
